$(document).ready(function(){$("#city_questions input:radio").click(pe.radioButtonClicked),$("#city_questions input:text").blur(pe.textBlurred),$("#unknown_venues").blur(pe.unknownVenuesBlurred),pe.init_page_framework()}),pe.radioButtonClicked=function(e){var t=$(e.target),n=t.closest("tr").attr("data_venue"),a=t.attr("value");$.ajax({url:"/writer_quizzes/"+window.quizId+"/save_answer",data:{venue:n,answer:a},type:"POST"})},pe.textBlurred=function(e){var t=$(e.target),n=t.closest("tr").attr("data_venue"),a=t.val();$.ajax({url:"/writer_quizzes/"+window.quizId+"/save_answer",data:{venue:n,comment:a},type:"POST"})},pe.unknownVenuesBlurred=function(e){var t=$(e.target).val();$.ajax({url:"/writer_quizzes/"+window.quizId+"/save_answer",data:{unlisted_venues:t},type:"POST"})};